import React, { useState, useEffect } from "react";



export const Mission = () => {

    const [missionData, handleMissionData] = useState([])


    async function getUserAsync() {
        let response = await fetch(`https://api.spacexdata.com/v3/launches?limit=100`);
        let data = await response.json()
        return data;
    }


    const dataValue = getUserAsync().then(data => console.log(data));

    console.log("-->", dataValue)

    handleData = () => {
        handleMissionData(dataValue)
    }

    useEffect(() => {
        dataValue;
    }, []);


    return (
        <div>fetching API data</div>
    )

}
